          <div class="file-field input-field">
            <div class="btn">

            </div>
            <div class="file-path-wrapper">
              <input class="file-path validate" type="text" />
            </div>
          </div>
        </form>
      </div>
      <div class="modal-footer">
        <button
          class="modal-close waves-effect waves-blue btn-flat"
          id="importBtn"
        >
          Import
        </button>
      </div>
    </div>
